import React, { Component } from 'react';

import {
  View,
  Text,
  Platform,
  TextInput,
  StyleSheet
} from 'react-native';


export default class CustomComponent extends Component{
    static propTypes = {
        FuelUp :JSON,
    }

    render(){
        return(
            <View style={styles.top} >
              <table>
                <tbody>
                  <tr>
                    <td>
                      <Text style={styles.text}>
                        {this.props.FuelUp.date}
                      </Text>
                    </td>
                    <td>
                      <Text style={styles.text}>
                        {this.props.FuelUp.price.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ' ')} Ft
                      </Text>
                    </td>
                  </tr>
                  <tr>
                    <td>
                      <Text style={styles.text}>
                          {this.props.FuelUp.mileage.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ' ')} km
                      </Text>
                    </td>
                    <td>
                      <Text style={styles.text}>
                          {this.props.FuelUp.volume} l
                      </Text>
                    </td>
                  </tr>
                  <tr>
                    <td>??? km</td>
                    <td>Who</td>
                  </tr>
                </tbody>
              </table>
                  
            </View> 
        )}
}
        
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'top',
  
  },
  top:{
    flex: 0.3,
    backgroundColor: "#6c757d",
    borderRadius: 20,   
    width:1000,
    marginBottom:10,
    padding: "10px"
  },
  text: {
    color: "#fff",
    fontSize: 25
  }
});
